import React from 'react';

const MyBookingSidebar = ({ cartItems }) => {
    return (
        <div className="my-booking-sidebar">
            <h2>My Booking</h2>
            {cartItems.map((item, index) => (
                <div key={index}>
                    <p>{item.name} - {item.quantity} pcs</p>
                    <p>{item.dateRange.startDate.toLocaleDateString()} - {item.dateRange.endDate.toLocaleDateString()}</p>
                </div>
            ))}
            <button>View Cart</button>
            <button>Checkout</button>
        </div>
    );
};

export default MyBookingSidebar;
